import React, { Component } from "react";
import usericon from "../img/nav_usericon.png";
import navlogo from "../img/nav-logo.svg";

class Navbar extends Component {
  state = {
    logo: navlogo,
    usericon: usericon,
    username: "user-name",
    mail: "username@mail.com",
  };

  render() {
    return (
      <div className="nav">
        <div className="logo">
            img
        </div>
        <div className="user-details">
          <img src={this.state.usericon} className="nav-logo" />
        </div>
      </div>
    );
  }
}

export default Navbar;
